import React from 'react';
import './App.css';

function App() {

  const buttonStyle = {backgroundColor:'blue', color:'white'}
  return (
    <div>
      <label>
        Enter the name :
      </label>
      <input id='name' type='text'/>
      <button style={buttonStyle} > Submit</button>
    </div>
  );
}

export default App;
